import React from 'react'
import Box from "@mui/material/Box";
import Typography from "@mui/material/Typography";
import logocompany from '../img/logo/logocompany.png'


function Navbar() {
  return (
    <div>
<Box sx={{width: '100%', height: '100px',background:'#2B2785',textAlign:'center',alignItems: 'center',display:'flex',justifyContent: 'center'}}>
           <Box sx={{display: 'flex',justifyContent:'flex-start'}}>
                <img style={{width:'90px',height:'80px'}} src={logocompany} alt="img" />
           </Box>
           <Box>

           </Box>
           
</Box>
    </div>
  )
}

export default Navbar
